import React from "react";
import "./Table.css";
import numeral from "numeral";

function Table(revenueInfo) {
  return (
    <div className="table">
      for (const key in revenueInfo){" "}
      {
        <tr>
          <td>{key}</td>
          <td>
            <strong>{numeral(revenueInfo[key]).format("0,0")}</strong>
          </td>
        </tr>
      }
    </div>
  );
}

export default Table;
